import React from 'react';
import './Main.css'
import Search from './../Search/Search';
import NewsCardList from './../NewsCardList/NewsCardList';
import About from './../About/About';
import Preloader from './../Preloader/Preloader';

const Main = props => {

    return (
      <main className="content">

        <Search />

        <NewsCardList />
        <About />
        <Preloader />




      </main>
    )
}

export default Main;
